import React from "react";
import "./style.css";

const Soicon = (props) => {
  return (
    <div>
      <a href="#" class="fa fa-facebook"></a>
      <a href="#" class="fa fa-twitter"></a>
      <a href="#" class="fa fa-google"></a>
    </div>
  );
};

export default soicon;
